import React from 'react';
import { Container } from 'react-bootstrap';

export default function Footer () {
    return (
        <Container>
            <address class="text-muted">
                <strong> PBX: </strong> (57) (5) 3715000 <strong> <br></br>
                Línea de atención: </strong>  (57) (5) 313-3400 / 300-910-9968 Calle 53B N° 46 - 25, Barranquilla - Atlántico <br></br> 
                <strong> Oficina Bogotá: </strong>  Dirección Calle 88 No. 13 A 07 <strong> Teléfono: </strong>  (1) 218 5733
            </address>
        </Container>
    )
}
